import { Input, Avatar, Button, ListItem } from 'react-native-elements';
import React, {useState} from 'react';
import { StyleSheet, Text, View, ScrollView } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import data from '../data.json'
import color from 'color';
import Example from './listItems'


const GroupManagement = ({ navigation }) => {
    const[isChecked, setIsChecked] = useState(false)
    const arr=[];

    const chooseEmployees =(e, element)=>{
        if(arr.length>4){
            return
        }
        arr.push(element)
    }

    return (
        <View>
            <ScrollView>{
                data.map((el, index) => {
                    return (<ListItem key={index} onPress={(e)=> chooseEmployees(e, el)}  containerStyle={styles.active}>
                        <ListItem.Content >
                            <ListItem.Title>{el.first_name + "/" + el.last_name}</ListItem.Title>
                            <ListItem.Subtitle>{el.gender}</ListItem.Subtitle>
                            <ListItem.Subtitle>{el.department + "/" + el.job_title}</ListItem.Subtitle>
                            <ListItem.Subtitle>{el.country + "/" + el.city}</ListItem.Subtitle>
                            <ListItem.Subtitle>{el.email}</ListItem.Subtitle>
                        </ListItem.Content>
                    </ListItem>
                    )
                })}
                 <Button
                title="Done"
                type="outline"
                onPress={()=>navigation.navigate('Home')}
            />
            </ScrollView>

        </View>
    )



}

export default GroupManagement;
